import React, {useState,useEffect} from 'react';
import {useNavigate} from 'react-router-dom'
import '../index.css';
import axios from 'axios';
const Info= async()=>{
  try{
  const navigate=useNavigate();
  const [datas,setDatas]=useState(null)
const res= await axios.get("http://localhost:3001/read") 
setDatas(res.data)
}catch(err){
  alert(err.message)
}
  return <>
  {datas?.payload.findAll.map((todo)=>{
    const {id, name,fatherName, motherName,address, image}=todo;
    return <article key={id} className="cardstyle">
    <p>Name:{name}</p>
    <img src={image} alt="photos" />
    <p>Father_Name:{fatherName}</p>
      <p>Mother_name:{motherName}</p>
      <p>Address:{address}</p>
    </article>
  })}
  </>
}
export default Info;
